import React from 'react';


function Contact(){
    return(
      <>
         <form action="/" class="form-signin w-100 m-auto" method="post">
    <img class="mb-4" src="/docs/5.3/assets/brand/bootstrap-logo.svg" alt="" width="72" height="72" />
    <h2 class="h3 mb-3 fw-normal">Sign Up to my Newsletter</h2>


      <input type="text"  name="fName" class="top form-control" id="floatingInput" placeholder="FirstName"/>
      <input type="text"  name="lName" class="middle form-control"  placeholder="LastName"/>
      <input type="email" name="mail" class="bottom form-control" id="floatingPassword" placeholder="name@example.com"/>

    <button class="btn btn-primary w-100 py-2" type="submit">Sign in</button>
    <p class="mt-5 mb-3 text-body-secondary">&copy; 2017â€“2023</p>
  </form>
      </>
    )
}

export default Contact;
